## Algorithm 1: QFNN-FFD Framework

Data: QNN circuit, dataset split among $N$ clients, learning rate $\eta=0.1$, maximum local iterations $T$.
Result: Accuracy, precision, recall, F1 score, and loss
Initialization: Parameters $\theta$ randomly initialized in $[0,1]$; for each client $i=1$ to $N$ do
Initialize local model parameters $\theta_{i} \leftarrow \theta$;
for each local iteration $t=1$ to $T$ do
for each batch in local dataset do
Encode data into quantum states;
Apply QNN circuit with current parameters $\theta_{i}$;
Perform quantum measurements to obtain classical outputs;
Calculate loss using MSE;
Optimize $\theta_{i}$ using Adam optimizer with learning rate $\eta$;
Evaluate local model on validation set and adjust $\theta_{i}$;
If convergence criteria are met, exit loop early;
Synchronize and send optimized local parameters $\theta_{i}$ to central server;
On central server.;
Aggregate local parameters to update global model; Broadcast updated global parameters $\theta$ back to each client;
for each client $i=1$ to $N$ do
Update local model parameters $\theta_{i} \leftarrow \theta$;
Evaluate model performance on a global validation set to ensure generalization;
